(function($,Drupal,once){Drupal.behaviors.webformImageFileModal={attach:function(context){$(once('webform-image-file-modal','.js-webform-image-file-modal',context)).on('click',function(){var img=new Image();img.src=$(this).attr('href');img.onload=function(){$('<div><img src="'+this.src+'" style="display: block; margin: 0 auto" /></div>').dialog({dialogClass:'webform-image-file-modal-dialog',width:this.width+60,height:this.height+100,resizable:!1,modal:!0}).dialog('open')};return!1})}}})(jQuery,Drupal,once)